import { createStore } from 'vuex'
import user from "@/plugins/vuex/authorization/user";
import register from "@/plugins/vuex/authorization/register";
import books from "@/plugins/vuex/books/books";
import bookInfo from "@/plugins/vuex/books/book-info";
export default createStore({
  modules: {
    user,
    register,
    books,
    bookInfo
  }
})
